import Books from "../components/Books";

class BookCollection extends Component {
  state = {
    books: []
  };

  componentDidMount() {
    fetch(BASEURL + "&printType=books&orderBy=newest&maxResults=40")
      .then(resp => resp.json())
      .then(data => this.setState({ books: data.items }));
  }

